description:
Bonjour a tous et a toutes,
Je vais quitter prochainement un cabinet d'osteopathie localise au sein d'un club BASIC FIT, situe dans la ville de Clichy (92), et je recherche un.e osteopathe pour reprendre la collaboration avec mon collegue deja en place.
Informations sur le cabinet :
Adresse : 3 Route du Port de Gennevilliers, 92110 Clichy ;
Loyer : partage avec mon collegue, il est de 380 EUR / mois, charges comprises, avec acces internet et point d'eau ;
Un climatiseur est a votre disposition ;
La carte d'acces au club BASIC FIT est incluse, ideal pour s'entrainer sur place a n'importe quel moment de la journee. La carte vous permet d'acceder a tous les clubs BASIC FIT de France ;
Cabinet deja integre dans la vie du club, avec une patientele variee : le cabinet est accessible aux adherents mais aussi aux non-adherents ;
Possibilite de completer avec une autre activite en parallele.
Profil recherche :
Osteopathe a l'aise avec tout type de techniques (structurelles, viscerales, craniennes, etc.) ;
Jeunes diplome.e.s bienvenu.e.s ;
Si possible, disposer de son propre compte Doctolib.
C'est une belle opportunite pour rejoindre un environnement dynamique, sportif et propice au developpement d'une patientele.
Pour plus d'informations ou visiter le cabinet, vous pouvez me contacter :
Par mail : yanisb.osteopathe@gmail.com
Par telephone : 06.51.35.65.46
Au plaisir d'echanger avec vous et de lire vos CVs.
